import React from 'react';
import { Link, NavLink, Outlet } from 'react-router-dom';
import logo from '../IIITH_logo.png';
import 'bootstrap/dist/css/bootstrap.css';


const Layout = () => {
  return (
    <div className="container">
      {/* Logo and Heading */}
      <div className="d-flex align-items-center">
        <img src={logo} alt="Logo" width="180" />
        <h1 className="ml-3">Visual Inspection Tool</h1>
      </div>

      {/* Navigation Bar */}
      <nav className="mt-3">
        <ul className="nav">
          <li className="nav-item dropdown">
            {/* <NavLink to="/dataset" className="nav-link dropdown-toggle" activeClassName="active"> */}
              Dataset
            {/* </NavLink> */}
            <ul className="dropdown-menu">
              <li>
                <NavLink to="/dataset/view" className="dropdown-item">View Dataset</NavLink>
              </li>
              <li>
                <NavLink to="/dataset/upload" className="dropdown-item">Upload Dataset</NavLink>
              </li>
            </ul>
          </li>
          <li className="nav-item dropdown">
            <NavLink to="/model" className="nav-link dropdown-toggle" activeClassName="active">
              Model
            </NavLink>
            <ul className="dropdown-menu">
              <li>
                <NavLink to="/model/train" className="dropdown-item">Train Model</NavLink>
              </li>
            </ul>
          </li>
          <li className="nav-item">
            <NavLink to="/logout" className="nav-link">Logout</NavLink>
          </li>
        </ul>
      </nav>

      {/* Render the current route */}
      <Outlet />
    </div>
  );
};

export default Layout;
